export function useCheckList(checkList = {}) {
    const list = reactive([]);

    checkList.forEach(el => {
        list.push(el);
    });

    const changeCheckItemStatus = (target) => {
        console.log(list)
    }

    return {
        list,

        changeCheckItemStatus
    };
}
